-- ----------------------------
-- View structure for `r_in_view`
-- ----------------------------
DROP VIEW IF EXISTS `r_in_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `r_in_view` AS select `b`.`id` AS `catid`,(case when (`a`.`reason` = _utf8'0') then `a`.`num` else 0 end) AS `inVendor`,(case when (`a`.`reason` = _utf8'1') then `a`.`num` else 0 end) AS `inInterlab`,(case when (`a`.`reason` = _utf8'2') then `a`.`num` else 0 end) AS `inSponsor`,(case when (`a`.`reason` = _utf8'3') then `a`.`num` else 0 end) AS `inCharges`,`a`.`inDate` AS `indate` from (`b_in` `a` join `b_cat` `b`) where ((`a`.`catno` = `b`.`catno`) and (`a`.`batchNo` = `b`.`batchno`) and (`a`.`price` = `b`.`price`)) ;

-- ----------------------------
-- View structure for `r_out_view`
-- ----------------------------
DROP VIEW IF EXISTS `r_out_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `r_out_view` AS select `b`.`id` AS `catid`,(case when (`a`.`reason` = _utf8'0') then `a`.`num` else 0 end) AS `outTrialTest`,(case when (`a`.`reason` = _utf8'1') then `a`.`num` else 0 end) AS `outValidation`,(case when (`a`.`reason` = _utf8'2') then `a`.`num` else 0 end) AS `outDiscard`,(case when (`a`.`reason` = _utf8'3') then `a`.`num` else 0 end) AS `outIntelLab`,(case when (`a`.`reason` = _utf8'4') then `a`.`num` else 0 end) AS `outSponsor`,(case when (`a`.`reason` = _utf8'5') then `a`.`num` else 0 end) AS `outOther`,`a`.`outDate` AS `outdate` from (`b_out` `a` join `b_cat` `b`) where ((`a`.`catno` = `b`.`catno`) and (`a`.`batchno` = `b`.`batchno`) and (`a`.`price` = `b`.`price`)) ;

-- ----------------------------
-- View structure for `r_price_view`
-- ----------------------------
DROP VIEW IF EXISTS `r_price_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `r_price_view` AS select `a`.`id` AS `catid`,(case when (`a`.`priceUnit` = _utf8'0') then `a`.`price` end) AS `CNY`,(case when (`a`.`priceUnit` = _utf8'1') then `a`.`price` end) AS `USD`,(case when (`a`.`priceUnit` = _utf8'2') then `a`.`price` end) AS `SGD`,(case when (`a`.`priceUnit` = _utf8'3') then `a`.`price` end) AS `EUR`,(case when (`a`.`priceUnit` = _utf8'4') then `a`.`price` end) AS `GBP`,(select round((`a`.`price` / `b`.`rate`),2) AS `round((``a``.``price`` / ``b``.``rate``),2)` from `d_rate` `b` where (`b`.`foreignMoney` = `a`.`priceUnit`) order by `b`.`startDateTime` desc limit 1) AS `localPrice` from `b_cat` `a` ;

-- ----------------------------
-- View structure for `r_qty_view`
-- ----------------------------
DROP VIEW IF EXISTS `r_qty_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `r_qty_view` AS select `r`.`id` AS `id`,`r`.`catid` AS `catid`,`r`.`flag` AS `flag`,(case when (month(now()) = 1) then 0 else round(ifnull(`r`.`cqtyIn`,0),2) end) AS `asQtyIn`,(case when (month(now()) = 1) then 0 else round(ifnull(`r`.`cqtyOut`,0),2) end) AS `asQtyOut` from `b_report_r` `r` where (`r`.`flag` = date_format((now() + interval -(1) month),_utf8'%Y%m')) ;

-- ----------------------------
-- Function structure for `getCatId`
-- ----------------------------
DROP FUNCTION IF EXISTS `getCatId`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `getCatId`(`p_catNo` varchar(255), p_batchNo varchar(255),p_price decimal,p_priceUnit varchar(255)) RETURNS varchar(255) CHARSET utf8
BEGIN
	#Routine body goes here...
    DECLARE v_catId,v_price,v_priceUnit VARCHAR(255);
 
    -- catno
    set p_catNo = REPLACE(IFNULL(p_catNo,'N/A'),' ','');
    IF p_catNo = '' or LOWER(p_catNo) = 'null' THEN
        set p_catNo = 'N/A';
    end IF;

    -- batchno
    set p_batchNo = REPLACE(IFNULL(p_batchNo,'N/A'),' ','');
    IF p_batchNo = '' or LOWER(p_batchNo) = 'null' THEN
        set p_batchNo = 'N/A';
    end IF;

    -- priceunit
    set v_priceUnit = getCodeName('money',p_priceUnit);
    IF v_priceUnit = '' or LOWER(v_priceUnit) = 'null' or ISNULL(v_priceUnit) THEN
        set v_priceUnit = 'N/A';
    end IF;

    -- price
    IF p_price = 0 or ISNULL(p_price) THEN
        set v_price = 'N/A';
    ELSE
        set v_price = CAST(ROUND(p_price*100) AS CHAR);
    end IF;
    
    set v_catId = CONCAT(p_catNo,'-',p_batchNo,'-',v_priceUnit,v_price);
	  RETURN v_catId;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `getCodeName`
-- ----------------------------
DROP FUNCTION IF EXISTS `getCodeName`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `getCodeName`(`p_codeType` varchar(255),`p_code` varchar(255)) RETURNS varchar(255) CHARSET utf8
BEGIN
	declare v_codeName VARCHAR(255);

  set v_codeName=(select a.codename from d_code a where a.codetype=p_codeType and a.code=p_code LIMIT 1);

	return (v_codeName);

END
;;
DELIMITER ;

